import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import '../css/style.css';
import '../fonts/icomoon/style.css';

useEffect(() => {
  console.log('Navbar component mounted');
  return () => {
    console.log('Navbar component unmounted');
  };
}, []);

const Navbar = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  // Function to toggle the menu state
  const handleMenuClick = () => {
    console.log('Menu clicked!');

    setIsMenuOpen(!isMenuOpen);
  };
  return (

<>
  <div className="site-mobile-menu site-navbar-target">
    <div className="site-mobile-menu-header">
      <div className="site-mobile-menu-close mt-3">
        <span className="icon-close2 js-menu-toggle" />
      </div>
    </div>
    <div className="site-mobile-menu-body" />
  </div>{" "}
  {/* .site-mobile-menu */}

  <div className="site-navbar-wrap">
    <div className="site-navbar-top">
      <div className="container py-3">
        <div className="row align-items-center">
          <div className="col-6">
            <div className="d-flex mr-auto">
              <a href="#" className="d-flex align-items-center mr-4">
                <span className="icon-envelope mr-2" />
                <span className="d-none d-md-inline-block">
                  info@domain.com
                </span>
              </a>
              <a href="#" className="d-flex align-items-center mr-auto">
                <span className="icon-phone mr-2" />
                <span className="d-none d-md-inline-block">
                  +1 234 4567 8910
                </span>
              </a>
            </div>
          </div>
          <div className="col-6 text-right">
            <div className="mr-auto">
              <a href="#" className="p-2 pl-0">
                <span className="icon-twitter" />
              </a>
              <a href="#" className="p-2 pl-0">
                <span className="icon-facebook" />
              </a>
              <a href="#" className="p-2 pl-0">
                <span className="icon-linkedin" />
              </a>
              <a href="#" className="p-2 pl-0">
                <span className="icon-instagram" />
              </a>
            </div>
          </div>
        </div>
      </div>
    </div>

    <div id="sticky-wrapper" className="site-navbar site-navbar-target js-sticky-header sticky-wrapper" style={{height: 69.2188 + 'px'}}>
      <div className="container">
        <div className="row align-items-center">
          <div className="col-2">
            <h1 className="my-0 site-logo">
              <a href="index.html">Brand</a>
            </h1>
          </div>
          <div className="col-10">
            <nav className="site-navigation text-right" role="navigation">
              <div className="container">
                <div className="d-inline-block d-lg-none ml-md-0 mr-auto py-3">
                  <a
                    href="#"
                    className="site-menu-toggle js-menu-toggle text-white"
                  >
                    <span className="icon-menu h3" />
                  </a>
                </div>
                <div className="openMenu" onClick={() => { console.log('Open menu clicked!'); handleMenuClick(); }}>
          <i className="fa fa-bars" />
                </div>
                <ul className={`site-menu main-menu js-clone-nav d-none d-lg-block ${isMenuOpen ? 'menu-open' : ''}`}>
                  <li className="active">
                  <Link to="/">Home</Link>
                  </li>
                  <li className="has-children">
                    <a href="#" className="nav-link">
                      Pages
                    </a>
                    <ul className="dropdown arrow-top">
                      <li>
                      <Link to="/">Home</Link>
                      </li>
                      <li>
                      <Link to="/listOfObject">Products</Link>
                      </li>
                      <li>
                      <Link to="/contact">Contact</Link>
                      </li>
                      <li>
                        <a href="#" className="nav-link">
                          FAQ
                        </a>
                      </li>
                      <li className="has-children">
                        <a href="#">More Links</a>
                        <ul className="dropdown">
                          <li>
                            <a href="#">Menu One</a>
                          </li>
                          <li>
                            <a href="#">Menu Two</a>
                          </li>
                          <li>
                            <a href="#">Menu Three</a>
                          </li>
                        </ul>
                      </li>
                    </ul>
                  </li>
                  <li>
                    <a href="#gallery-section" className="nav-link">
                      Sign up
                    </a>
                  </li>
                  <li>
                    <a href="#contact-section" className="nav-link">
                      Log in
                    </a>
                  </li>
                  <div className="closeMenu" onClick={() => { console.log('Close menu clicked!'); handleMenuClick(); }}>
                    <i className="fa fa-times" />
                  </div>
                </ul>
              </div>
            </nav>
          </div>
        </div>
      </div>
    </div>
  </div>
</>
  );
};

export default Navbar;



